BLUEKING.version=function(){return{init:function(){BLUEKING.version.get(function(i){BLUEKING.version.set(i)}),$("#version-info .close").on("click",function(){BLUEKING.version.hide()})},get:function(i){$.ajax({type:"POST",url:urlPrefix+"get_version_info/",success:function(n){n.result&&i&&i(n.data)}})},set:function(i){$("#version-info .body").html(versionInfoTemp({version:i.version,valid_period:i.valid_period,expired_time:i.expired_time}))},show:function(){BLUEKING.maskBox.version().show(),$("#version-info").show()},hide:function(){BLUEKING.maskBox.version().hide(),$("#version-info").hide()}}}();